&quot;The heroine of the series is the eponymous character, Cybersix, a leather-clad artificial human superhero who by day operates behind the guise of a male high school literature teacher, and by night battles the monstrous biological weapons of her creator. She is aided in her adventures by her younger brother Cyber-29, who is reborn in the body of a black panther known as Data 7. The extended cast includes Cybersix's colleague and love interest Lucas Amato, as well as other supporting characters.&quot;
